chai
  .request(app)
  .post("/api/products")
  .send({
    name: "test",
    price: 100,
  })
  .end((err, res) => {
    res.should.have.status(201);
    res.body.should.be.a("object");
    res.body.should.have.property("data").have.property("name").eql("test");
    done();
  });

chai
  .request(app)
  .put("/api/products/1")
  .send({
    name: "test",
    price: 100,
  })
  .end((err, res) => {
    res.should.have.status(200);
    res.body.should.be.a("object");
    res.body.should.have.property("data").have.property("name").eql("test");
    done();
  });

chai
